def locations():
    '''Returns the list of all latitude, longtitude locations in all data.
    This list doesn't need to be modified, so the output of this function is copied and pasted
    into the main program. '''
    location =[]
    for month in list_of_months:
        for day in list_of_days:
            try:
                with open(f"/Users/mbahng/PycharmProjects/Coronavirus_Analysis/Data_by_Date/{month}{day}20.txt") as f:
                    for line in f:
                        if line.split(",")[1:3] not in location:
                            location.append(line.split(",")[1:3])
                print(f"{month}{day}")
            except:
                continue
    return location
